import { Footer, FirstForm } from '../Components';

function FirstPage() {
  return (
    <div className="page-container">
      <h1 id="forms-header">Primeira parede</h1>
      <FirstForm />
      <Footer />
    </div>
  )
}

export default FirstPage;
